#!/usr/bin/env python3
from hypothesis import given, strategies as st, settings
from pandas.io.sas.sas7bdat import _parse_datetime
import pandas as pd

# First, test the exact failing cases
print("Testing exact failing inputs from the bug report:")
print("-" * 60)

# Test the exact failing input for days
try:
    result = _parse_datetime(2936550.0, 'd')
    print(f"_parse_datetime(2936550.0, 'd') = {result}")
except OverflowError as e:
    print(f"✗ OverflowError for days (2936550.0): {e}")

# Test the exact failing input for seconds
try:
    result = _parse_datetime(253717920000.0, 's')
    print(f"_parse_datetime(253717920000.0, 's') = {result}")
except OverflowError as e:
    print(f"✗ OverflowError for seconds (253717920000.0): {e}")

print("\nNow running hypothesis tests:")
print("-" * 60)

failed_days = []
failed_seconds = []

@given(st.floats(allow_nan=False, allow_infinity=False))
@settings(max_examples=100)
def test_parse_datetime_days_no_crash(x):
    try:
        result = _parse_datetime(x, "d")
        assert result is not None or pd.isna(result)
    except OverflowError as e:
        failed_days.append(x)
        raise

@given(st.floats(allow_nan=False, allow_infinity=False))
@settings(max_examples=100)
def test_parse_datetime_seconds_no_crash(x):
    try:
        result = _parse_datetime(x, "s")
        assert result is not None or pd.isna(result)
    except OverflowError as e:
        failed_seconds.append(x)
        raise

# Run the tests
try:
    test_parse_datetime_days_no_crash()
    print("✓ Days test passed all examples")
except Exception as e:
    print(f"✗ Days test failed")
    if failed_days:
        print(f"  Failed values: {failed_days[:5]}")

try:
    test_parse_datetime_seconds_no_crash()
    print("✓ Seconds test passed all examples")
except Exception as e:
    print(f"✗ Seconds test failed")
    if failed_seconds:
        print(f"  Failed values: {failed_seconds[:5]}")
